import Vue from 'vue'
import VueRouter from 'vue-router'

import homePage from '@/views/user/homePage'
// import homePage from '../views/user/homePage';
import blogPage from '../views/user/blogPage';
import catagoryPage from '../views/user/catagoryPage';
import tagPage from '../views/user/tagPage';
import aboutme from '../views/user/aboutMePage'
import blogManPage from '../views/admin/blogManPage'
import blogPublishPage from '../views/admin/blogPublishPage'
import login from '../views/admin/loginPage'

Vue.use(VueRouter)

const routes = [
  {
    path: '/admin',
    component: login,
    children:[
      {
        path: 'blogPublishPage',
        component: blogPublishPage
      },
      {
        path: 'blogManPage',
        component: blogManPage
      }
    ]
  },
  {
    path: '/',
    component: homePage,
    children:[
      {
        path: '',
        component: homePage
      },
      {
        path: 'aboutMe',
        component: aboutme
      },
      {
        path: 'tagPage',
        component: tagPage
      },
      {
        path: 'catagoryPage',
        component: catagoryPage
      },
      {
        path: 'blogPage',
        component: blogPage
      }
    ]
  }

]

export default new VueRouter({
  routes
})
